export default function Header() {
  return (
    <header>
      <h1>Brian Bawuah</h1>
      <ul
        style={{
          display: "flex",
          justifyContent: "space-between",
          listStyleType: "none",
          paddingInlineStart: '0'
        }}
      >
        <li>Home</li>
        <li>About me</li>
        <li>My work</li>
        <li>Contact</li>
      </ul>
    </header>
  );
}
